# ‚ïî‚ïê‚ï° 8d30dcd6-5482-4242-b07c-3b7e493c0919
struct MyMatrix{A}
	v::A
end

# ‚ïî‚ïê‚ï° 4737cdf6-6257-4590-af19-3a48b7793e85
begin
	Base.size(x::MyMatrix) = (length(x.v), length(x.v))
	Base.size(x::MyMatrix, i) = size(x)[i]
end

# ‚ïî‚ïê‚ï° eb84b0ef-58c9-49e1-9600-90037785e332
function Base.getindex(x::MyMatrix, i, j)
	if i == j
		v = x.v[i]
		return v + v^2
	else
		return x.v[i] * x.v[j]
	end
end

