X = randn(1024)

# ‚ïî‚ïê‚ï° 6c8e088e-9c64-41b7-9018-32f5ecef99d1
diagm(X) + X*X'

# ‚ïî‚ïê‚ï° 2ff60be3-8991-4685-a096-cccc037019ba
