# ‚ïî‚ïê‚ï° 87d64a36-0ebc-49a9-b7d6-84be78de0357
f(A::MyMatrix)  = Œª ->  1 + mapreduce((v) -> v^2 / (v - Œª)  , +, A.v)

# ‚ïî‚ïê‚ï° 992d215e-10f1-4d5b-92ca-8c1e1206ff6d
f‚Ä≤(A::MyMatrix) = Œª ->      mapreduce((v) -> v^2 / (v - Œª)^2, +, A.v)

# ‚ïî‚ïê‚ï° a5b21944-0ab4-473a-8c66-80eadb4481a6
function LinearAlgebra.eigmax(A::MyMatrix; tol = eps(2.0), debug = false)
    x0 = maximum(A.v) + maximum(A.v)^2
    Œ¥ = f(A)(x0)/f‚Ä≤(A)(x0)
    while abs(Œ¥) > x0 * tol               
        x0 -= Œ¥
        Œ¥ = f(A)(x0)/f‚Ä≤(A)(x0) 
        debug && println("x = $x0, Œ¥ = $Œ¥") # Debugging
    end
    x0
end

# ‚ïî‚ïê‚ï° d8392b7c-35f8-4950-8c5c-7566b157d75d
eigmax(diagm(X) + X*X')

