# ‚ïî‚ïê‚ï° 31601984-9540-4105-a677-61e76c8fde74
function delta(A::MyMatrix, Œª)
	g(v) = @SArray [v^2 / (v - Œª), v^2 / (v - Œª)^2]
	f, f‚Ä≤ = mapreduce(g, +, A.v) + @SArray [1, 0]
	f/f‚Ä≤
end

# ‚ïî‚ïê‚ï° fe7f1f3f-dbb0-40e1-966c-e97fcf4a0897
function eigmax2(A::MyMatrix; tol = eps(2.0), debug = false)
    x0 = maximum(A.v) + maximum(A.v)^2
    Œ¥ = delta(A, x0)
    while abs(Œ¥) > x0 * tol               
