md"""
## Compilation of a dynamic language.

Julia uses LLVM for it's compilation pipeline.

**Compiler stages**
1. Parsing
2. Lowering
3. Abstract interpretation based type-inference
4. High-level optimizations
5. Codegen to LLVM IR
6. LLVM middle-end
7. LLVM backend
8. Native code
"""

